import React from 'react';
import Card from './Card';

const CardList = ({robots}) => {
    return(
    <div>
    <Card id = {robots[0].id} name = {robots[0].name} position = {robots[0].position} />
    <Card id = {robots[1].id} name = {robots[1].name} position = {robots[1].position} />
    <Card id = {robots[2].id} name = {robots[2].name} position = {robots[2].position} /> 
    </div>
    );

}

export default CardList;
